import React, { Component } from 'react';
import { RegDropButton } from './RegistrationDrop/registrationDrop';
import { NewPaymentButton } from './newPayment'
import { NewTaskButton } from './newTask';
import { NavegationButton } from './navegation';

export default class App extends Component {
  render() {
    return (
      <div>
        <NewPaymentButton />
        <NewTaskButton />
        <NavegationButton />
        <RegDropButton />
      </div>
    );
  }
}
